description:
Caught in the Crossfire (2010)  

Verenigde Staten
Misdaad
85 minuten

geregisseerd door Brian A Miller
met 50 Cent, Chris Klein en Adam Rodriguez

Caught in the Crossfire gaat over corruptie binnen de politie. Twee rechercheurs krijgen bij het onderzoek naar een moordzaak te maken met een groep corrupte agenten en een criminele bende. Tino (50 Cent) is een bendelid dat informant wordt van de politie.

